function addPipe() {
    var tubeDown = this.tubeDown.basicCopy()
    var tubeUp = this.tubeUp.basicCopy()

    // tubeDown.setExtent(pt(tubeDown.getExtent().x,Math.random()*184+100))
    tubeDown.setScale(Math.random()*0.5+0.5)
    // this.tubeDown.setName('tubeDown')
    tubeUp.setExtent(pt(tubeUp.getExtent().x,this.y-(tubeDown.getExtent().y+Math.random()*50+50)))
    // tubeUp.setName('tubeUp')
    this.addMorph(tubeDown).setPosition(pt(this.x,0))
    this.addMorph(tubeUp).setPosition(pt(this.x,this.y))
    this.pipes.push(tubeDown)
    this.pipes.push(tubeUp)
}

994.source:
function flap() {
    var self = this
    var cPos = this.bird.getPosition()
    if(this.bird.getPosition().y>=this.groundY)
        this.reset()
    else if(this.hitPipes())
        this.reset()
    else {
        this.curSpeed += this.g;
        this.bird.setPosition(pt(cPos.x,Math.max(cPos.y + this.curSpeed,0)))
    }
}

997.source:
function hitPipes() {
    var self = this
    for(var i=0; i<this.pipes.length; i++){
        if(this.pipes[i].getName()=='coralDown') {
            if(this.bird.getPosition().x >= this.pipes[i].getPosition().x
            && this.bird.getPosition().x <= this.pipes[i].getPosition().x+this.pipes[i].getExtent().x
            && self.bird.getPosition().y <= this.pipes[i].getExtent().y)
            {
                alert('bird:'+self.bird.getPosition().y+'pipe:'+this.pipes[i].getExtent().y)
                return true
            }
        }
        else {
            if(this.bird.getPosition().x >= this.pipes[i].getPosition().x
            && this.bird.getPosition().x <= this.pipes[i].getPosition().x+this.pipes[i].getExtent().x
            && self.bird.getPosition().y <= this.y
            && self.bird.getPosition().y >=this.y-this.pipes[i].getExtent().y)
                return true
        }
    }
    return false
}

