function onKeyPress(evt) {
    var self = this
    if(evt.keyCode==116){
        if(this.gameState==0){
            this.start()
            this.birdInterval = Global.setInterval(function(){self.flap()},100)
            this.addPipeInterval = Global.setInterval(function(){self.addPipe()},3000)
            this.movePipesInterval = Global.setInterval(function(){self.movePipes()},10)
        } 
        this.curSpeed = this.initSpeed
    }
}

